      | 50140 -> { ItemTypeData.id= 50140; name= "Kikimora Metamateria Exotica SKIN (Permanent)"; published= true; description= "Experiments with Triglavian ship technology have included focus on the various metamaterials used in their construction. Taking advantage of the similarity of Triglavian hull coatings to the nanocoatings used with New Eden ship technology, a number of tests have been carried out aimed at achieving stealth effects in Abyssal Deadspace environments.    One attempt at achieving a disruptive, stealth camouflage effect involved using exotic metamaterials to achieve a similarity to the exotic particle fields that can be found in certain abyssal environments. While the resultant nanocoating pattern is very striking, it is of very limited use as camouflage, with detection systems being quite capable of picking out ships using it even against the background of heavy exotic particle storms."; marketGroupId= Some(2521); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
